import React, { Component } from 'react';
import { Row, Col } from 'react-bootstrap';
import { withRouter } from 'react-router-dom';


const initialValues = {};
  

class Table extends Component {

    state = {
        motor_list: [
          {
            "id": "1",
            "product": "Two Wheeler Insurance",
            "image" : "two-wheeler.svg"
          },
          {
            "id": "2",
            "product": "Four Wheeler Insurance",
            "image" : "Four-Wheeler.svg"
          },
          {
            "id": "3",
            "product": "Passenger Carrier Vehicle Insurance",
            "image" : "pessenger-car.svg"
          },
          {
            "id": "4",
            "product": "Goods Carrier Vehicle Insurance",
            "image" : "goods-car.svg"
          },
          {
            "id": "5",
            "product": "Miscellaneous Insurance",
            "image" : "Miscellaneous-car.svg"
          }
        ],

        health_list: [
            {
              "id": "6",
              "product": "Arogoya Sanjeevani",
              "image" : "Miscellaneous-car.svg"
            }            
          ]
      };

    buy_policy = (productId) => {
        console.log("productId", productId)
        this.props.history.push(`/Health/${productId}`);
    }
    componentDidMount() {
    }


    render() {
        const { motor_list, health_list } = this.state;

        return (
            <Row>
                <Col sm={12}>
                    <div className="tablecontent">
                        <table>
                            {(this.props.tabId == '1') ? 
                                (<tbody>                                
                                    {motor_list.map((part, partIndex) => ( 
                                    <tr key={partIndex}>
                                        <td className="W-10"><img src={require(`../../assets/images/${part.image}`)} alt="" /></td>
                                        <td className="W-70">{part.product}</td>
                                        <td className="W-10 text-right"> <button className="buy">Buy</button></td>
                                        <td className="W-10 text-right"> <button className="renew">Renew</button></td>
                                    </tr>
                                    ))
                                    }
                                </tbody>) : 

                                (<tbody>
                                    {health_list.map((part, partIndex) => ( 
                                    <tr key={partIndex}>
                                        <td className="W-10"><img src={require('../../assets/images/Miscellaneous-car.svg')} alt="" /></td>
                                        <td className="W-70">{part.product}</td>
                                        <td className="W-10 text-right"> <button className="buy" onClick= {this.buy_policy.bind(this, part.id )} >Buy</button></td>
                                        <td className="W-10 text-right"> <button className="renew">Renew</button></td>
                                    </tr>
                                    ))
                                    }
                                </tbody>)
                            }
                        </table>
                    </div>
                    </Col>
                  </Row>  
        ) 
    }
}

export default withRouter (Table);
